import React from 'react'
import '../../App.css';


function Music() {
    return (
        <>
            <h1>Hello from Music</h1>
            <div style="position: relative; padding-bottom: 100%; height: 0; overflow: hidden; max-width: 100%;"><iframe src="https://embed.tidal.com/albums/154182567?layout=gridify" frameborder="0" allowfullscreen style="position: absolute; top: 0; left: 0; width: 100%; height: 1px; min-height: 100%; margin: 0 auto;"></iframe></div>
        </>
    )
}

export default Music
